import React, { Component } from 'react';
import {questionObj, resp} from './questions'
import $ from "jquery";


class Logic extends Component {
    constructor(props) {
        super(props);
        this.state = {
            question: { questionObj},
            counter: 0,
            ipWars: {},
            resData: [],
            resArr: {resp},
            readyToTypeset: false,
            mathjaxConfig: {
                tex: { packages: { "[+]": ["input"] } },
                startup: {
                    ready() {
                        const Configuration =
                            window.MathJax._.input.tex.Configuration.Configuration;
                        const CommandMap = window.MathJax._.input.tex.SymbolMap.CommandMap;
                        const TEXCLASS = window.MathJax._.core.MmlTree.MmlNode.TEXCLASS;

                        new CommandMap(
                            "input",
                            { input: "Input" },
                            {
                                Input(parser, name) {
                                    const xml = parser.create("node", "XML");
                                    const id = parser.GetBrackets(name, "");
                                    const w = parser.GetBrackets(name, "5em");
                                    const value = parser.GetArgument(name);
                                    xml.setXML(
                                        window.MathJax.startup.adaptor.node("input", {
                                            id: id,
                                            value: value,
                                            style: { width: w },
                                            xmlns: "http://www.w3.org/1999/xhtml",
                                        }),
                                        window.MathJax.startup.adaptor
                                    );
                                    xml.getSerializedXML = function () {
                                        return this.adaptor.outerHTML(this.xml) + "</input>";
                                    };
                                    parser.Push(
                                        parser.create(
                                            "node",
                                            "TeXAtom",
                                            [
                                                parser.create("node", "semantics", [
                                                    parser.create("node", "annotation-xml", [xml], {
                                                        encoding: "application/xhtml+xml",
                                                    }),
                                                ]),
                                            ],
                                            { texClass: TEXCLASS.ORD }
                                        )
                                    );
                                },
                            }
                        );
                        Configuration.create("input", { handler: { macro: ["input"] } });

                        MathJax.startup.defaultReady();
                    },
                },
            },
        }
    }

    componentDidMount() {
        window.MathJax = this.state.mathjaxConfig;
        let script = document.createElement("script");
        script.defer = true;
        script.src = "https://cdn.jsdelivr.net/npm/mathjax@3/es5/tex-chtml.js";
        document.head.appendChild(script);
    }

    componentDidUpdate() {
        window.MathJax.typesetPromise();
    }


    ApiCall = (qNum, stepN, args) => {
        let responseData = this.state.resArr.resp[stepN];
        for (let i = 0; i < responseData.data.length; i++) {
            if (parseInt(args[`s${stepN + 1}v${i + 1}`]) != parseInt(responseData.data[i])) {
                return {
                    status: "wrong",
                    data: responseData.text
                }
            }
        }
        return {
            status: "success",
            data: "Awesome"
        }

    }


    clickFunc = (stepNum, noOfInputs) => {
        let ipVar = {};
        for (let j = 1; j <= noOfInputs; j++) {
            ipVar[`s${stepNum + 1}v${j}`] = $(`#s${stepNum + 1}v${j}`).val();
        }
        this.setState({ ipWars: ipVar }, () => {
            let data = this.ApiCall(1, stepNum, this.state.ipWars);
            let resARR = this.state.resData;
            resARR.push(data.data);
            this.setState({ resData: resARR });
            let k = this.state.counter + 1;
            this.setState({ counter: k });
        })
    };
    render() {
        return (
            <div>
                <p>{this.state.question.questionObj.Qtext}</p>
                {this.state.question.questionObj.Steps.map((step, i) => {
                    console.log(step.step_txt);
                    if (i <= this.state.counter) {
                        return (
                            <div id={step.id}>
                                <p>{step.step_txt}</p>
                                {
                                    this.state.resData[i] == 'Awesome' ? (
                                       this.state.resData[i] ? <p style={{ color: 'green' }}>{this.state.resData[i]}</p> : null ) : (this.state.resData[i] ? <p style={{ color: 'red' }}>{this.state.resData[i]}</p> : null )}

                                {i == this.state.counter ? (
                                    <button onClick={() => this.clickFunc(i, step.n_params)}>
                                        next step
                                    </button>
                                ) : (
                                    <div></div>
                                )}
                            </div>
                        );
                    } else {
                        return (
                            <div id={step.id} style={{ display: "none" }}>
                                <p>{step.step_txt}</p>
                                {
                                    this.state.resData[i] ? <p>{this.state.resData[i]}</p> : null
                                }
                                <button onClick={() => this.clickFunc(i, step.n_params)}>next step</button>
                            </div>
                        );
                    }
                })}
            </div>
        );
    }

}

export default Logic;
